def draw_frame(surface, anim_name, frame_idx, x, y, scale=1):
    key = f'{anim_name}_{frame_idx}'
    if key not in FRAMES:
        return

    pixels = FRAMES[key]
    for px, py, color in pixels:
        pygame.draw.rect(surface, color, (x + px*scale, y + py*scale, scale, scale))
